import React from 'react';
import HeroSection from './components/HeroSection';
import Navbar from './components/Navbar';
import ServicesOverview from './components/ServicesOverview';

function App() {
  return (
    <div className="App">
      <Navbar />
      <HeroSection />
      <ServicesOverview />
    </div>
  );
}

export default App;
